'use strict';

var logger = require('@ebay/logging-inc').logger('tracking-ebay:warmup');

module.exports = function warmup() {
    return require('./entities/cache').get(function (err) {
        if (err) {
            logger.error('warmup fail ', err);
        }
        else {
            logger.debug('warm up finished!');
        }
        return true;
    });
};
